export default function Home() {
  return (
    <Layout>
      <Head>
        <title>Create Next App</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>

      {/* <Login /> */}
      <Box w="100%" py={5}>
        <Flex align="center">
          <Avatar size="md" mr={2} />
          <Input variant="outline" placeholder="Whats on your mind, Freddie?" />
        </Flex>
      </Box>

      <Stack w="100%" py={5}>
        <Post />
        <Post />
        <Post />
      </Stack>
    </Layout>
  );
}
